import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to GameBot</h1>
      <p>Click the chess icon to start playing</p>
      <Link to="/chess">
      </Link>
    </div>
  );
};

export default Home;
